__all__ = [
    'NullDate'
]


import datetime

from typing import Optional


class NullDate(datetime.datetime):
    

    filetime: Optional[int] = None

    def __eq__(self, other) -> bool:
        if isinstance(other, NullDate):
            return True
        return super().__eq__(other)

    def __ne__(self, other) -> bool:
        if isinstance(other, NullDate):
            return False
        return super().__eq__(other)